import React from 'react'
import QuantityBtn from './QuantityBtn'

export default function SortQuantity () {
    const contentBtns = ['All', 'Done', 'Undone']

    return (
        <div className='main__buttons'>
            {contentBtns.map(item => <QuantityBtn title={item}/>)}
        </div>
    )
}
